  }

  render() {

    return (
      <div>

        <style jsx>
          {`

          `}
        </style>

        <Carousel
          clickToChange
          centered
          infinite
          slidesPerPage={2}
        >
          {(
          this.props.stores==null
            ?""
            :this.props.stores.map((store) => (
              <Magnet 
                store={store} 
                key={"featured_"+store._id}
                changeSelectedStore={(newstore)=>this.changeSelectedStore(newstore)}
                openSelectedStore={()=>this.setState({storeCardOpen:true})}
              />
            ))
          )}
        </Carousel>
      </div>
    )
  }
}

export default FridgeMagnets;
